import React from "react";
import Quotes from "../Quotes";
import "./pages/Quotes.css";

const InspirationalQuotes = () => {
  return (
    <>
      <h2>Get inspired everyday!</h2>
      <div className="quote">
        <Quotes />
      </div>
    </>
  );
};

export default InspirationalQuotes;
